import React from 'react';

const img ='https://www.metaweather.com/static/img/weather/png/';

const Today = (props) =>{
  const {today, title} = props;
  return(
      <div className='today'>
        {
          today && (
            <>
            <div>
              <button>Search for places</button>
            </div>
            <div>
                <img src={`${img}${today.weather_state_abbr}.png`} alt="no load"/>
            </div>
            <div>
              <h1>{today.the_temp}</h1>
              <h2>{today.weather_state_name}</h2>
              <p>today.applicable_date</p>
              <p>title</p>
            </div>
            </>
          )
        }
      </div>
  );

};

export default Today;
